                <div id="cid_10" class="jfCard-wrapper">
                  <div class="jfCard" data-type="control_textbox"><div class="jfCard-index"><div>12</div></div><div class="jfCard-question"><div class="jfQuestion-fullscreen isHidden" aria-hidden="true" role="button" aria-label="fullscreen mode" tabindex="-1"></div><label for="input_10" class="jfQuestion-label isCenterAlign" id="label_10"><span class="jsQuestionLabelContainer jfQuestionLabelContainer"><strong>What's your Instagram @? (optional)</strong></span></label><span class="jfQuestion-description" id="input_10_description"><span></span></span><div class="jfCard-mobileError jsMobileErrorWrapper"></div><div class="jfQuestion-fields"><div class="jfField" data-type="textbox"><input type="text" id="input_10" name="q10_whatsYour10" data-type="input-textbox" class="form-textbox validate[Fill Mask] jfInput-input" size="20" value="" placeholder="@username" data-component="textbox" aria-required="false" aria-describedby="input_10_description" aria-labelledby="label_10"/><label class="jfField-sublabel " for="input_10"></label></div></div></div><div class="jfCard-actions"><button style="display:block" type="button" class="jfInput-button forPrev u-left" data-component="button" aria-label="PREVIOUS">PREVIOUS</button><button style="display:block" type="button" class="jfInput-button forNext u-right" data-component="button" aria-label="NEXT">NEXT</button><button style="display:none" type="submit" class="jfInput-button forSubmit form-submit-button u-right" data-component="button" aria-label="NEXT">NEXT</button><div class="cf"><div class="jfCard-actionsNotification" aria-live="polite"><div class="jfPressEnter isHidden" aria-hidden="true">Press<br/>Enter</div></div></div><div class="jfCard-disableSubmitError"></div></div></div>
