              <li class="form-line" data-type="control_text" id="id_17">
                <div id="cid_17" class="jfCard-wrapper">
                  <div class="jfCard" data-type="control_text"><div class="jfCard-index"><div>13</div></div><div class="jfCard-question"><div class="jfQuestion-fullscreen isHidden" aria-hidden="true" role="button" aria-label="fullscreen mode" tabindex="-1"></div><div class="jfCard-mobileError jsMobileErrorWrapper"></div><div class="jfQuestion-fields"><div class="jfField"><div id="text_17" class="form-html" data-component="text"><p style="text-align: center;"><strong><span style="font-size: 24pt;">Logo Design Contract of Agreement</span></strong></p>
                  <p> </p>
                  <p>I ask that you agree to this contract before we start on your Logo Design.</p>
                  <p><strong>What SIMAR VFX agrees to‚Ä¶</strong><br />We agree to create a custom Logo Design suitable for your business identity and satisfactory to you. We promise to deliver your finished Logo Design in digital image files of high enough quality to be printed on business related print goods and for web page display.</p>
                  <p><br />Logo Concepts and First Viewing: Within 5 business days of receiving your company info and payment, we will create a logo concept for you. We will deliver the sample via email. After receiving your feedback about the design, we will make any needed changes until you are completely satisfied. (Excessive or unreasonable changes may result in additional charges at an hourly rate.)</p>
                  <p>File Delivery: After the final Logo Design is approved we agree to deliver the Logo Design to you as a digital file (.png, .pdf, .ai, .eps, .jpg and/or .psd graphics file formats).</p>
                  <p>Ownership: we give you the right to use your new logo design in all media useful for your business promotion. We ask that you let us display your new logo image and your full name, business name, and website address or company address, for testimonial and promotional purposes on our website and social media platforms.</p>
                  <p>Originality: we affirm that our Logo Designs are 100% original and we own the rights granted under this agreement, and that the rights granted do not conflict any other agreement.</p>
                  <p>Request: If you display your new logo on a website we would love to have a text link posted somewhere on your website pointing to our website or social media at: http://www.SIMAR VFX.com or @SIMAR VFX. Link to your website: If we receive nice words from you (a testimonial) we will post it on our website or social media with a link to your website or social media page.</p>
                  <p><br /><strong>What you, the buyer, agrees to...</strong><br />In return for the above-described Logo Design I agree to pay the total fee payable in one non-recurring  payment.</p>
                  <p><br />Ownership: I understand that the final Logo Design belongs to SIMAR VFX until I have approved the work and received the final files via email. In the event of termination of this Agreement SIMAR VFX owns the Logo and has the right to complete, exhibit, and/or sell the Logo Design (but not my business name) if she so chooses. She also owns any and all the Logo Design concepts created before I choose the final Logo Design.</p>
                  <p>Use of Logo: I understand that once I receive the logo files I have the right to use the Logo Design in all media useful for business promotion and that SIMAR VFX reserves the right to display the logo for her business promotional use (example of her Logo Designs on her websites or printed on flyers).</p>
                  <p>I also give SIMAR VFX permission to use my full name and/or website address, for testimonial purposes on her website, or other business related media.</p>
                  <p>Right to Modify (Alterations): I understand that I have no right to alter the final Logo Design in anyway, except to change its size for printing or digital display. If I desire any alterations I will consult SIMAR VFX first, and they will be allowed the first option to make alterations when possible and I do understand that they will require additional payment to make these alterations.</p>
                  <p>Request: I will consider SIMAR VFX request that I put a text link to their Website or Instagram on my website.</p>
                  <p>(Example: Logo created by @SIMAR VFX) Thank you!</p>
                  <p>(Example: Logo created by www.SIMAR VFX.com) Thank you!</p>
                  <p>Copyrights and Trademarks: I understand that it is up to me to copyright the Logo Design (www.copyright.gov) after receiving the final files. It is also up to me to do a Trademark search and federal trademark registration if I want to register my Logo as my company Trademark. (Start here to learn more about Trademarks: www.uspto.gov/main/trademarks.htm)</p>
                  <p>Delays: I agree to give SIMAR VFX more time due to illness, injury, or delay because of events beyond their control, like: fire, theft, computer failure, and Acts of God.</p>
                  <p>Termination: I have the right to terminate this Agreement if, SIMAR VFX fails to complete the Logo within 30 days of the signing of this agreement or if, illness or injury, or events beyond her control causes a delay of more than 30 days from the agreed delivery date.</p>
                  <p>If terminated, SIMAR VFX shall refund the full payment to me. I understand that I cannot claim any additional expenses, damages, or claims based on the failure of SIMAR VFX to complete the logo.</p>
                  <p>NOTE: Before you sign below please make sure you understand all of the above agreement and realize that you can negotiate. If you want any changes please send me your suggestions.</p>
                  <p>If this contract is acceptable to you and you are paying with Paypal then, this contract will be considered signed with deposit of money into our Paypal account.</p></div></div></div></div><div class="jfCard-actions"><button style="display:block" type="button" class="jfInput-button forPrev u-left" data-component="button" aria-label="PREVIOUS">PREVIOUS</button><button style="display:block" type="button" class="jfInput-button forNext u-right" data-component="button" aria-label="NEXT">NEXT</button><button style="display:none" type="submit" class="jfInput-button forSubmit form-submit-button u-right" data-component="button" aria-label="NEXT">NEXT</button><div class="cf"><div class="jfCard-actionsNotification" aria-live="polite"><div class="jfPressEnter isHidden" aria-hidden="true">Press<br/>Enter</div></div></div><div class="jfCard-disableSubmitError"></div></div></div>
                </div>
